function drop_info.indexOf(index)
    if index == nil then
        return nil
    end
    return setmetatable({_raw = drop_info._data[index]}, m)
end

function drop_info.get(id)
    local k = id
    return drop_info.indexOf(__index_id[k])
end

function drop_info.set(id, key, value)
    local record = drop_info.get(id)
    if record then
        local keyIndex = __key_map[key]
        if keyIndex then
            record._raw[keyIndex] = value
        end
    end
end

function drop_info.get_index_data()
    return __index_id
end

